void PostEffectsDlg::new_uniform_ok(Fl_Button* btn, PostEffectsDlg* dlg) {
  btn->parent()->hide();
  
  // TODO: More uniform types!
  ::window.glbox->getPostProcessor()->addFloatUniform(dlg->uniform_name_edit->value());
  ::window.glbox->getPostProcessor()->setFloatUniformValue(dlg->uniform_name_edit->value(), dlg->uniform_value_edit->value());
  
  dlg->update_uniform_list();
}

void PostEffectsDlg::new_uniform_cancel(Fl_Button* btn, PostEffectsDlg*) {
  btn->parent()->hide();
}

void PostEffectsDlg::update_uniform_list() {
  uniforms_browser->clear();
  PostProcessor* pp = ::window.glbox->getPostProcessor();
    
  uniforms_browser->begin();
  for(int i = 0; i < pp->getNumUniforms(); i++)
  {
    uniforms_browser->add(pp->getUniformName(i));
  }
  uniforms_browser->end();
}

void PostEffectsDlg::update_uniform_float(Fl_Button* btn, PostEffectsDlg* dlg) {
  PostProcessor* pp = ::window.glbox->getPostProcessor();
  int idx = dlg->uniforms_browser->value()-1;
  
  if(idx < 0) return;
  
  switch(pp->getUniformType(idx))
  {
  	case M_VARIABLE_FLOAT:
          	pp->setFloatUniformValue(pp->getUniformName(idx), dlg->uniform_value->value());
  	break;
  }
}

void PostEffectsDlg::save_profile_callback(Fl_Button* widget, PostEffectsDlg* dlg) {
  const char* filename = fl_native_file_chooser("Choose file", "*.ini", (current_project.path + "shaders").c_str(), Fl_Native_File_Chooser::BROWSE_SAVE_FILE);
  
  if(filename == NULL)
  	return;
  
  ofstream out;
  out.open(filename, ios::out);
  if(!out)
  	return;
  
  out << "[Uniforms]" << endl;
  
  PostProcessor* pp = ::window.glbox->getPostProcessor();
  
  // TODO: Allow other variable types!
  for(int i = 0; i < pp->getNumUniforms(); i++)
  {
  	out << pp->getUniformName(i) << "=" << pp->getFloatUniformValue(i) << endl;
  }
  
  out.close();
}

void PostEffectsDlg::load_profile_callback(Fl_Button* widget, PostEffectsDlg* dlg) {
  const char* filename = fl_native_file_chooser("Choose file", "*.ini", (current_project.path + "shaders").c_str(), Fl_Native_File_Chooser::BROWSE_FILE);
    
  if(filename == NULL)
  	return;
    
  INI::Parser parser(filename);
  PostProcessor* pp = ::window.glbox->getPostProcessor();
  
  // TODO: More types!  
  for(INI::Level::value_map_t::iterator iter = parser.top()("Uniforms").values.begin(); iter != parser.top()("Uniforms").values.end(); iter++)
  {
  	pp->addFloatUniform(iter->first.c_str());
  	float value;
  
  	sscanf(iter->second.c_str(), "%f", &value);
  	pp->setFloatUniformValue(iter->first.c_str(), value);
  }
  
  dlg->update_uniform_list();
}

void PostEffectsDlg::update_resolution(Fl_Value_Input* value, PostEffectsDlg* dlg) {
  PostProcessor* pp = ::window.glbox->getPostProcessor();
  pp->setResolutionMultiplier(value->value());
  
  MEngine::getInstance()->getGame()->getPostProcessor()->setResolutionMultiplier(value->value());
}

